// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Voting {
    struct Voter {
        uint weight;      // Weight is accumulated via delegation
        bool voted;       // Has the voter already voted?
        address delegate; // Address delegated to
        uint vote;        // Index of the voted proposal
    }

    struct Proposal {
        bytes32 name;   // Proposal name (bytes32 for simplicity)
        uint voteCount; // Total votes for this proposal
    }

    address public chairperson;
    mapping(address => Voter) public voters;
    Proposal[] public proposals;

    /// @notice Constructor: Initializes proposals
    constructor(bytes32[] memory proposalNames) {
        chairperson = msg.sender;
        voters[chairperson].weight = 1;
        for (uint i = 0; i < proposalNames.length; i++) {
            proposals.push(Proposal({
                name: proposalNames[i],
                voteCount: 0
            }));
        }
    }

    /// @notice Give a voter the right to vote.
    function giveRightToVote(address voter) public {
        require(msg.sender == chairperson, "Only chairperson can give rights");
        require(!voters[voter].voted, "The voter already voted.");
        require(voters[voter].weight == 0, "Voting right already given");
        voters[voter].weight = 1;
    }

    /// @notice Cast a vote for a proposal.
    function vote(uint proposal) public {
        Voter storage sender = voters[msg.sender];
        require(!sender.voted, "Already voted.");
        require(proposal < proposals.length, "Invalid proposal index");
        sender.voted = true;
        sender.vote = proposal;
        proposals[proposal].voteCount += sender.weight;
    }

    /// @notice Compute the winning proposal
    function winningProposal() public view returns (uint winningProposal_) {
        uint winningVoteCount = 0;
        for (uint p = 0; p < proposals.length; p++) {
            if (proposals[p].voteCount > winningVoteCount) {
                winningVoteCount = proposals[p].voteCount;
                winningProposal_ = p;
            }
        }
    }

    /// @notice Returns the name of the winning proposal.
    function winnerName() public view returns (bytes32 winnerName_) {
        winnerName_ = proposals[winningProposal()].name;
    }
}
